svg.script:

if(window.parent && window.parent.Wincor && window.parent.Wincor.UI && window.parent.Wincor.UI.Content) {
    let styleRes = window.parent.Wincor.UI.Content.StyleResourceResolver;
    if(styleRes) {
    	let style = document.getElementsByTagName("style")[0];
      	style.innerHTML = style.innerHTML.replace("default/svg.css", styleRes.type() + "svg.css");
       styleRes = null;
    }
}


let attr = this.frameElement.attributes['data-warning-circle'];

if(window.parent && window.parent.Wincor && window.parent.Wincor.UI && window.parent.Wincor.UI.Content) {
    let vm = window.parent.Wincor.UI.Content.ViewModelContainer.getById("flexMain");
    if(vm) {
        let max = vm.maxItems();
        if (max && max !== '') {
            if ( max.length > 2) {
                // smaller font for number consisting of more than 2 digits
                document.getElementById("countValue").setAttribute("class", "color03 font05");
            }
            document.getElementById("countValue").textContent = max + "+";
            if (attr) {
                document.getElementById("warningCircle").style.display = "block";
            }
        } else {
            document.getElementById("countValue").style.display = "none";
        }

    }
}
